member.remarks:
To use this request, you need to create a KeyValueCollection that allows you to supply information about the objects you want to get information about. If you want to ask about all of the objects of a particular type in your configuration layer, you can leave this filter key empty. Otherwise, you will need to supply information that identifies the objects you are interested in, such as the name of an agent, as shown here:
[C#] KeyValueCollection filterKey = new KeyValueCollection(); filterKey.Add("user_name", userName);
Now you are ready to create the request. If you want to get information about an agent, you need to specify its object type as a Person, which is the object type used by Configuration Server for agents. Here is how to do that:
[C#] RequestReadObjects requestReadObjects = RequestReadObjects.Create( (int) CfgObjectType.CFGPerson, filterKey);
After you have created your request, you can send it to Configuration Server, as shown here:
[C#] confServerProtocol.Send(requestReadObjects);
If the request is successful, you will receive one or more EventObjectsRead messages, depending on how much data Configuration Server needs to send. Once the server has finished sending this data, it will send an EventObjectsSent message, which confirms that it has finished.

 The information you asked for is returned in the ConfObjectfield of the
 EventObjectsRead message.

 Here is a sample of how you might print the XML document:

 [C#]
 EventObjectsRead objectsRead = theMessage;

 StringBuilder xmlAsText = new StringBuilder();
 XmlWriterSettings xmlSettings = new XmlWriterSettings();
 xmlSettings.Indent = true;

 using (XmlWriter xmlWriter = 
 	XmlWriter.Create(xmlAsText, xmlSettings))
 {
	XDocument resultDocument = objectsRead.ConfObject;
 	resultDocument.WriteTo(xmlWriter);
 }

 Console.WriteLine("This is the response:\n"
 		+ xmlAsText.ToString() + "\n\n");


 It is important to note that Configuration Server may send more than one
 of these messages in response to your request, depending on how much data
 needs to be returned. Your application must be ready to handle all of these
 messages.

 Your application also needs to process the EventObjectsSent message 
 that Configuration Server will send to indicate that it has finished 
 providing the data you requested.

